import { Fragment } from "react"
import classes from './HeaderCartButton.module.css';
import icon from '../Cart/CartIcon';

 const HeaerCartButton = () =>{
    <Fragment>
        <span className={classes.icon} src={icon}></span>
        <span className={classes.button}>Cart</span>
        <span className={classes.button}>3</span>
        <span className={classes.badge}></span>
    </Fragment>
 }

 export default HeaerCartButton;
